function changeEventContainerPosition() {
  var e = $('#footer').offset().top,
    n = $(window).height(),
    t = e - 0.5 * n,
    e = $('body').height() - n - 5,
    n = window.pageYOffset,
    t = t < n;
  (t || (e <= n && !t)) && $('.event-details__container').css('bottom', '450px');
}
function scrollFunction(e, n) {
  20 < document.body.scrollTop || 20 < document.documentElement.scrollTop
    ? ((e.style.display = 'block'), (n.style.top = '0px'))
    : (e.style.display = 'none'),
    120 < document.body.scrollTop || 120 < document.documentElement.scrollTop
      ? ($('.event-details__container').css('bottom', '50px'), changeEventContainerPosition())
      : $('.event-details__container').css('bottom', '-250px');
}
function topFunction() {
  (document.body.scrollTop = 0), (document.documentElement.scrollTop = 0);
}
function mobileNavMenuRender() {
  const e = [].slice.call(document.querySelectorAll('.nav-expand'));
  e.forEach((e) => {
    e.querySelector('.nav-expand-content').insertAdjacentHTML(
      'afterbegin',
      `<li class="nav-item">
	<a class="nav-link nav-back-link" href="javascript:;">
		رجوع
	</a>
</li>`,
    ),
      e.querySelector('.nav-link').addEventListener('click', () => e.classList.add('active')),
      e.querySelector('.nav-back-link').addEventListener('click', () => e.classList.remove('active'));
  });
  const n = document.getElementById('openMenu'),
    t = document.getElementById('closeMenu');
  n.addEventListener('click', function () {
    $('.header__mobile').fadeIn('slow');
  }),
    t.addEventListener('click', function () {
      $('.header__mobile').fadeOut('slow');
    });
}
jQuery(document).ready(function (t) {
  new Swiper('.header__swiper', {
    slidesPerView: 1,
    spaceBetween: 30,
    freeMode: !0,
    watchSlidesVisibility: !0,
    watchSlidesProgress: !0,
    pagination: { el: '.header .swiper-pagination', clickable: !0 },
    navigation: {
      nextEl: '.header__navigation .swiper-button-next',
      prevEl: '.header__navigation .swiper-button-prev',
    },
  }),
    new Swiper('.version__slider', {
      slidesPerView: 4,
      spaceBetween: 10,
      pagination: { el: '.version .swiper-pagination', clickable: !0 },
      breakpoints: { 320: { slidesPerView: 2, spaceBetween: 20 }, 480: { slidesPerView: 4, spaceBetween: 20 } },
      on: { init: function () {}, resize: function () {} },
    }),
    new Swiper('.media-center__swiper__video', {
      observer: !0,
      spaceBetween: 10,
      navigation: {
        nextEl: '.media-center__swiper__video__controls .swiper-button-next',
        prevEl: '.media-center__swiper__video__controls .swiper-button-prev',
      },
      pagination: { clickable: !0 },
      breakpoints: {
        320: { slidesPerView: 1, spaceBetween: 20 },
        480: { slidesPerView: 1, spaceBetween: 20 },
        768: { slidesPerView: 2, spaceBetween: 20 },
        991: { slidesPerView: 4, spaceBetween: 20 },
      },
    }),
    new Swiper('.media-center__swiper__images', {
      slidesPerView: 5,
      spaceBetween: 10,
      observer: !0,
      observeParents: !0,
      breakpoints: {
        320: { slidesPerView: 1, spaceBetween: 20 },
        480: { slidesPerView: 1, spaceBetween: 20 },
        768: { slidesPerView: 2, spaceBetween: 20 },
        991: { slidesPerView: 4, spaceBetween: 20 },
      },
    });
  ['.partners__swiper', '.partners-2__swiper', '.sponsor__swiper', '.sponsor-2__swiper'].forEach((e) => {
    new Swiper(e, {
      slidesPerView: 3,
      spaceBetween: 30,
      navigation: { nextEl: e + '__controls .swiper-button-next', prevEl: e + '__controls .swiper-button-prev' },
      breakpoints: {
        320: { slidesPerView: 1, spaceBetween: 20 },
        480: { slidesPerView: 1, spaceBetween: 20 },
        768: { slidesPerView: 2, spaceBetween: 20 },
        991: { slidesPerView: 3, spaceBetween: 20 },
      },
      on: { init: function () {}, resize: function () {} },
    });
  }),
    setTimeout(() => {
      t('.loader').fadeOut('slow');
    }, 1e3),
    t('#openSearchBtn').on('click', () => {
      t('.header__nav__search__form').addClass('header__nav__search__form--active');
    }),
    t(document).on('click', function (e) {
      0 ===
        t(e.target).closest(['.header__nav__search', '#openSearchBtn', '#openSearchBtnWithMobile'].join(',')).length &&
        (t('.header__nav__search').hide(), t('body').removeClass('backdrop'));
    }),
    t('#openSearchBtnWithMobile').on('click', (e) => {
      topFunction(),
        e.preventDefault(),
        t('#searchMobile').toggleClass('mt-3').toggleClass('h-auto').toggleClass('w-100');
    });
  const e = document.getElementById('gotToTopButton'),
    n = document.querySelector('.header__mobile-nav');
  e.addEventListener('click', topFunction),
    (window.onscroll = function () {
      scrollFunction(e, n);
    }),
    mobileNavMenuRender();
  let o = !1;
  t('#advancedSearch').on('click', (e) => {
    e.preventDefault(),
      (o = !o),
      o
        ? ((e.target.innerHTML = '- بحث عادي'), t('#advancedSearchContainer').fadeIn('slow'))
        : ((e.target.innerHTML = '+ بحث متقدم'), t('#advancedSearchContainer').fadeOut('slow'));
  }),
    t('#FAQAccordion').collapse({ toggle: !1 }),
    t('#FAQAccordion').on('hidden.bs.collapse', function (e) {
      console.log(e);
    }),
    t('.show-password').on('click', function () {
      var e = t(this).siblings('.form-control'),
        n = t(e).attr('type');
      t(e).attr('type', 'password' === n ? 'text' : 'password'), t(this).toggleClass('utl-color-primary');
    }),
    (wow = new WOW({ boxClass: 'wow', animateClass: 'animated', offset: 0, mobile: !0, live: !0 })),
    wow.init();
});
